    return (
        <div>
            <span className="nav-item">강의</span>
            <span className="nav-item">로드맵</span>
            <span className="nav-item">멘토링</span>
            <span className="nav-item">커뮤니티</span>
            <span className="nav-item">인프런</span>
        </div>
    );
};

export default MainNavMenu;
